import { Outlet } from 'react-router-dom';
import Navbar from '../navbar/navbar';

const Layout = () => {
  return (
    <div className="App">
      <Navbar />

      <main style={{display: 'block', background: 'blue', zIndex: 100}}>
        <Outlet />
      </main>
    </div>
  );
};

export default Layout;
